import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Applayout from "./components/Applayout";


export default function App() {

    return (
        // the routing structure
        <
        BrowserRouter >
        <
        Routes >
        <
        Route path = "/"
        element = { < Applayout / > } > < /Route>

        <
        /Routes> <
        /BrowserRouter>
    )

}
